import React from "react";
import ArticleCard from "../components/ArticleCard";

const articleTitle = "Article Title Cool";

function List() {
  return (
    <div className="pageWrapper">
      <h1>Articles List</h1>
      <ArticleCard
        blurb="words and words and words"
        date=""
        imageAlt="hi"
        imageSrc="hi again"
        title={articleTitle}
      />
      <ArticleCard />
    </div>
  );
}

export default List;
